import { Comfortaa_700Bold, Inter_400Regular } from "@expo-google-fonts/dev";
//#454F84 <- night time color
//#7D8CDC <- day time color

export const colors = {
    BACKGROUND_COLOR: '#7D8CDC',
    BOX_BACKGROUND: '#546DC550',
    FONT_COLOR: '#EAEBED',
    GREEN: '#ABCAC3',
    RED: '#D84845',
    YELLOW: '#F39237' 
};

export const size = {
    HEADER: 72,
    HEADER2: 24,
    BODY: 14
};

export const fonts = {
    HEADER: 'Comfortaa_700Bold',
    BODY: 'Inter_400Regular'
};
